import React from 'react';
import { Avatar, Box, Typography, useMediaQuery } from '@mui/material';
import { Email, Phone } from '@mui/icons-material';
import './ContactPage.css';
import avtar from '../images/img'

const ContactPage = () => {
  const isMobile = useMediaQuery('(max-width: 768px)');

  return (
    <Box className={isMobile ? 'contact-container-mobile' : 'contact-container'}>
      <Avatar alt="User Avatar" src={avtar} className="avatar" />
      <Typography variant="h5" className="contact-title">Contact Us</Typography>
      <Box className="contact-info">
        <Box className="contact-item">
          <Email className="contact-icon" />
          <Typography variant="body1">your-email@gmail.com</Typography>
        </Box>
        <Box className="contact-item">
          <Phone className="contact-icon" />
          <Typography variant="body1">+1 234 567 890</Typography>
        </Box>
      </Box>
    </Box>
  );
};

export default ContactPage;
